import React from 'react';
import UsersService from '../../services/UsersService';

import { Container, Grid, Paper } from '@material-ui/core';
import Sidebar from '../sidebar/SideBar';


class Home extends React.Component {

    componentDidMount() {

        UsersService.getUsers('users').then(
            res => {
                this.setState({users: res.data})

            },
            err => {
                console.log(err);
            }
        )
    }

    render() {

        function FormRow() {
            return ( //return renders the grid
            <React.Fragment>
                <Grid item xs={4}>
                <Paper className={Paper}>item</Paper>
                </Grid>
                <Grid item xs={4}>
                <Paper className={Paper}>item</Paper>
                </Grid>
                <Grid item xs={4}>
                <Paper className={Paper}>item</Paper>
                </Grid>
            </React.Fragment>
            );
        }

        return (
            <Container maxWidth="false">
            <Sidebar/>
                <div className="home-page">
                    <Grid container spacing={5} justify="center">
                        <Grid item >
                            <FormRow/>
                        </Grid>
                        <Grid item>
                            <Paper className="home-buttons" elevation={ 5 }/>
                        </Grid>
                        <Grid item>
                            <Paper className="home-buttons" elevation={ 5 }/>
                        </Grid>
                        <Grid item>
                            <Paper className="home-buttons" elevation={ 5 }/>
                        </Grid>
                        <Grid item>
                            <Paper className="home-buttons" elevation={ 5 }/>
                        </Grid>
                        <Grid item>
                            <Paper className="home-buttons" elevation={ 5 }/>
                        </Grid>
                        <Grid item>
                            <Paper className="home-buttons" elevation={ 5 }/>
                        </Grid>
                        <Grid item>
                            <Paper className="home-buttons" elevation={ 5 }/>
                        </Grid>
                    </Grid>
                </div>
            </Container>
        )        
    }
}

export default Home;
